import React from 'react'
import "./styles/Background.css";
import { Container } from '@mui/system';
import { Grid } from '@material-ui/core';

function Background() {
  return (
    <div className='background'>
         <Container>
            <Grid container spacing={0}>
                <Grid item md={6}>
                </Grid>
            </Grid>
         </Container>
    </div>
  )
}

export default Background;
